Description:
@michael_nielsen 3 years ago I set out to gain as much agency over AI technology as I could due to instrumental convergence among other reasons. People who feel technology is just something done to them are missing the insight that it's at its most mutable ever. 



> I find it striking how many of the people discussing AI and AI risk are technocrats.  This is true of e/acc, doomers, EAs, VCs, researchers, safety people, AI startups, etc.  They're all united by a sense of agency over, and broad belief in, technology, even when they disagree on…  
> – @michael_nielsen
